    }

    function getColor(id) {
        // console.log(id)
    return id > 45 ? '#800026' : 
            id > 40  ? '#BD0026' :
            id > 35  ? '#E31A1C' :
            id > 30  ? '#FC4E2A' :
            id > 25   ? '#FD8D3C' :
            id >= 10   ? '#FEB24C' :
            id < 10   ? '#FED976' :
                      '#FFEDA0';
    }

    function style(feature) {
	return {
		fillColor: getColor(feature.geometry.properties.id),
		weight: 2,
		opacity: 1,
		color: 'white',
		dashArray: '3',
		fillOpacity: 0.7
	};
    }

     function highlightFeature(e) {
        var layer = e.target;
        
        layer.setStyle({
            weight: 5,
            color: '#666',
            dashArray: '',
            fillOpacity: 0.7
            });
            
            layer.bringToFront();

            info.update(layer.feature.geometry.properties);
        
    }

    function resetHighlight(e) {
        geojson.resetStyle(e.target);
        info.update();
        // console.log(e.target.feature.geometry.properties)
        }
    
    function onEachFeature(feature, layer) {
	layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight
        });
        }

    var info = L.control()
    info.onAdd = function (map) {
	    this._div = L.DomUtil.create('div', 'legend'); // create a div with a class "info"
	    this.update();
	    return this._div;
    };

    // method that we will use to update the control based on feature properties passed
    info.update = function (props) {
	    this._div.innerHTML = (props ?
		    '<div style="padding: 10px 12px; font: 14px/16px Arial, Helvetica, sans-serif; background: white; background : rgba(241, 238, 238, 0.8); box-shadow: 0 0 15px rgba(0,0,0,0.2); border-radius: 5px;"><br /><b>' + props.Name + '</b><br /></br></div>'
		    : '');
    };
    // L.geoJSON(geojson).addTo(map);
    info.addTo(map);
    geojson = L.geoJson(geojson, { style: style, onEachFeature: onEachFeature }).on('click', function() { window.location = ('/#/Dashboard')}).addTo(map)
  }

}
